import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>Input Postman Collection ID</p>
        <div>
          <input/>
          <button>Test</button>
        </div>
          <div>
              <p className="current-results">Current Validation Results</p>
              <p className="previous-results">Previous Validation Results</p>
          </div>
      </header>
    </div>
  );
}

export default App;
